Text:
@Rebali007:

Om du inte fått hem de sista 128kb på över två månader, så får du nog se över dina inställningar. Jag har seedat denna kontinuerligt i ett år ungefär, och har en ratio på över 35. 

Det är alltså minst 35 som laddat ner denna det senaste året. Trots det är jag nästan alltid ensam om att seeda -- skamligt med alla otacksamma parasiter som bara snor åt sig och sedan sticker... :(
